import React from "react";
import { makeStyles, TextField } from "@material-ui/core/";

import { FieldTitle } from "../../../atoms";
import Icons from "../../../../resources/icons";
import "./index.scss";

const useStyles = makeStyles((theme) => ({
  paper: {
    margin: theme.spacing(0, 4),
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
}));

export const RegisterSix = ({ user, onUserChange }) => {
  const classes = useStyles();
  return (
    <div className={classes.paper} id="bank-information-form">
      <FieldTitle icon={Icons.email} label="Banco" />
      <TextField
        className="field"
        variant="outlined"
        margin="normal"
        name="bankName"
        placeholder="Banco Santander"
        value={user.bankName}
        onChange={onUserChange}
        inputProps={{ tabIndex: "1" }}
      />
      <FieldTitle icon={Icons.strongbox} label="NÃºmero de cuenta bancaria" />
      <TextField
        className="field"
        variant="outlined"
        margin="normal"
        name="bankAccount"
        placeholder="ES00 12XX 22XX 33XX 44XX"
        value={user.bankAccount}
        onChange={onUserChange}
        inputProps={{ tabIndex: "2" }}
      />
      <FieldTitle icon={Icons.hashtag} label="Swift" />
      <TextField
        className="field"
        variant="outlined"
        margin="normal"
        placeholder="ESXX"
        name="swift"
        value={user.swift}
        onChange={onUserChange}
        inputProps={{ tabIndex: "3" }}
      />
    </div>
  );
};
